import React, { useState } from "react";

function ButtonChangePath() {
  const [newPath, setNewPath] = useState("");

  const changePath = () => {
    const path = newPath;
    setNewPath(path);
  };

  return (
    <button role="button" onClick={changePath}>
      Current theme: {path}
    </button>
  );
}

export default ButtonChangePath;
